import React from 'react';
import { Navbar, Nav } from 'react-bootstrap';

const Header = (props) => {
	return(
	<Navbar bg="dark" variant="dark">
		<Navbar.Brand href="#home">Navbar</Navbar.Brand>
			<Nav className="mr-auto">
				<Nav.Link href="#US">Home</Nav.Link>
				<Nav.Link href="#business">Features</Nav.Link>
				<Nav.Link href="#technology">Pricing</Nav.Link>
				<Nav.Link href="#sports">Home</Nav.Link>
				<Nav.Link href="#entertainment">Features</Nav.Link>
				<Nav.Link href="#health">Pricing</Nav.Link>
				<Nav.Link href="#science">Pricing</Nav.Link>
			</Nav>
	</Navbar>
		)
	}
	export default Header;
